import React from 'react';
import Commons from './Commons';
import web1 from '../src/images/w2.png'


const About=()=> {
  return (
    <Commons name='Explore your potential with CodinGyaan' imgsrc={web1} visit='/contact' btname='Get Started'></Commons>
  );
}

export default About;
